import logo from './logo.svg';
import './App.css';
import ShowUsers from './components/Usuarios';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

function App() {
	return (
		<div className="App">
			<BrowserRouter>
				<Routes>
					<Route path='/' element={ <ShowUsers/> } className="p-5" />
				</Routes>
			</BrowserRouter>
		</div>
	);
}

export default App;
